import React from 'react'
import styled from 'styled-components'
import Navbar from './Navbar';

function Home() {
  return (
    <Container>
    <Navbar/>
    <Banner>
        {/* <img src="./img/im15.jpg" alt="" />
        <img src="./img/im13.jpg"/> */}
        <img src="./img/E3.jpg" alt="" />
        <img src="./img/im13.jpg"/>
    </Banner>
    </Container>
  )
}


const Container = styled.div`

`;
const Banner = styled.div`
    width:100%;
    img{
        width:100%;
        -webkit-mask-image:linear-gradient(
            to bottom,
            rgba(0,0,0,2),
            rgba(0,0,0,0.85),
            rgba(0,0,0,0.75),
            rgba(0,0,0,0.55),
            rgba(0,0,0,0)
            );

            &:nth-child(2) {
                display:none;
            }
            @media only screen and (max-width:767px){
                &:nth-child(1) {
                    display:none;
                }
                &:nth-child(2){
                    display:block;
                }
            }
    }

`;

export default Home
